svg.script:
//
        window.addEventListener("DOMContentLoaded", () => {




          let colorful_layers = ["Code-colorful", "Use-colorful", "Build-colorful", "Reuse-colorful"];

          console.log(colorful_layers.length)

          var setOpacity = (elemId, opacity) => {
            document.getElementById(elemId).style['opacity'] = opacity;
          };

          // grayout all colorful layers
          for(var l of colorful_layers) {
            setOpacity(l, 0.0);            
          }

          setOpacity(colorful_layers[0], 1.0);  


          var curr_ix = 0;         

          var highlightNext = () => {
            var current = colorful_layers[curr_ix];
            setOpacity(current, 0.0);

            curr_ix++;

            if(curr_ix >= colorful_layers.length) curr_ix = 0;

            var next = colorful_layers[curr_ix];
            setOpacity(next, 1.0);
          }          

          setInterval(highlightNext, 4000)

        });
    //
